import React from 'react';

const imgArr = [
	{img: '', text: '"The Harvesters" by Peter Bruegel, 1565 (Met Museum)'},
	{img: '', text: 'Second'},
	{img: '', text: 'Third'}
]

const num =  Math.round(Math.random()*(mesArr.length-1));

const message = () => {
	return mesArr[num]
}

const Banner = (props) => {
	return (
		<div>
			<p>{
				message()
			}</p>
			<div id='banner' title={imgArr[num].text}></div>
		</div>
	);
}

export default Banner;
